import React, { useContext } from 'react';
import { MedicinesContext, MedicinesProps } from '../App';

const MedicineList = () => {
    const { medicines} = useContext(MedicinesContext) as MedicinesProps;
    console.log("las medicines", medicines.pills);
    return (
        <section className='first-section-wrapper'>
            <h2>Lista de medicamentos</h2>

            <h3>Pastillas</h3>
            <table>
                <tr>
                    <th>
                        Marca que ofrecemos
                    </th>
                    <th>
                        Laboratorio
                    </th>
                    <th>
                        Precio(sin cobertura m√©dica)
                    </th>
                </tr>  
                {medicines.length !== 0 || medicines.length !== undefined ? medicines.pills.map((pill: { brand: string, laboratory: string, price: number }) => (
                    <tr>
                        <td>{pill.brand}</td>
                        <td>{pill.laboratory}</td>
                        <td>{pill.price}</td>
                    </tr>
                )) : "Cargando"}
            </table>
            <h3>Anillos</h3>

            <h3>Parches</h3>
        </section>
    );
}

export default MedicineList;
